import React from 'react';
import { useTranslation } from 'react-i18next';

function Dummy() {
  const { t } = useTranslation();

  const lan = async () => {
   const res = await fetch("https://libretranslate.com/translate", {
      method: "POST",
      body: JSON.stringify({
         q: "",
         source: "auto",
         target: "fr",
         format: "text",
         alternatives: 3,
         api_key: ""
      }),
      headers: { "Content-Type": "application/json" }
   });
   
   console.log(await res.json());
  }
  return (
    <div className='container'>
      <h1 className='dummycss'>hello {t('welcomeMessage')}</h1>
      <h6>Hello - I am a good boy</h6> <br />      <h6>Hello - I am a good boy</h6> <br />
      <h6>Hello - I am a good boy</h6> <br />
      <h6>Hello - I am a good boy</h6> <br />
      <h6>Hello - I am a good boy</h6> <br />
      <h6>Hello - I am a good boy</h6> <br />
      <h6>Hello - I am a good boy</h6> <br />

     </div>
  );
}

export default Dummy;
